package leetcode

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestLongestPalindrome(t *testing.T) {
	for _, tc := range []struct {
		s    string
		want string
	}{
		{
			s:    "abcda",
			want: "a",
		},
		{
			s:    "anna",
			want: "anna",
		},
		{
			s:    "madam",
			want: "madam",
		},
		{
			s:    "amadam",
			want: "madam",
		},
		{
			s:    "babad",
			want: "bab",
		},
		{
			s:    "cbbd",
			want: "bb",
		},
		{
			s:    "b",
			want: "b",
		},
		{
			s:    "",
			want: "",
		},
		{
			s:    "",
			want: "ranynar",
		},
		{
			s:    "",
			want: "yvvy",
		},
		{
			s:    "",
			want: "aqkqa",
		},
		{
			s:    "",
			want: "jtdtj",
		},
	} {
		t.Run(tc.s, func(t *testing.T) {
			assert.Equal(t, tc.want, longestPalindrome(tc.s))
		})
	}
}
